// Importando o React
import React, { Component } from "react";
// Importando os components necessários da lib react-materialize
import { Row, Table} from 'react-materialize';

class Tbl extends Component {

  constructor() {
    super();

    this.state = {
        investment: [
            { 'type': 'renda fixa', 'value': 1500, 'date': "27/06/2020" },

        ]
    }
  }

  render() {
    const {investment } = this.state;

    <Row>
      <Table className="highlight centered">
          <thead>
            <tr>
                <th>Data</th>
                <th>Valor</th>
                <th>Excluir</th>
            </tr>
          </thead>

          <tbody>
            <tr>
              <td>05/06/2020</td>
              <td>R$ 1.500,00</td>
              <td><a>X</a></td>
            </tr>
          </tbody>
      </Table>
    </Row>
  }
}

export default Tbl;
